import styled from 'styled-components';

export const Container = styled.div`
    display: grid;
    background-color: #3e3d42;
    grid-template-columns: 1fr 2fr 1fr;
    min-width: 100%;
    min-height: 90vh;
    box-sizing: border-box;
`;
